# -*- coding: utf-8 -*-
from PyQt5.QtCore import *
from PyQt5.QtGui import *
from PyQt5.QtPrintSupport import QPrinterInfo, QPrinter
import urllib.parse, re

from PyQt5.QtWebChannel import QWebChannel
from PyQt5.QtWebEngineWidgets import QWebEngineView


class Printer:

    def __init__(self, p):
        printer = []
        printerInfo = QPrinterInfo()
        print('availablePrinterNames', printerInfo.availablePrinterNames())
        print('defaultPrinterName', printerInfo.defaultPrinterName())
        if p is None or p == "":
            self.p = QPrinterInfo.defaultPrinter()
            self.print_device = QPrinter(self.p)
        else:
            for item in printerInfo.availablePrinters():
                printer.append(item.printerName())
            if p in printer:
                self.p = QPrinter(p)
            else:
                self.p = QPrinterInfo.defaultPrinter()
            self.print_device = QPrinter(self.p)  # 指定打印所使用的装置

    def print(self, content):
        # 设置打印内容的宽度，否则打印内容会变形
        self.print_device.setPageSizeMM(QSizeF(110, 250))
        d = QTextDocument()  # 使用QTextDcument对html进行解析
        font = d.defaultFont()
        font.setBold(True)
        font.setPointSize(font.pointSize() + 1)
        d.setDefaultFont(font)
        font.setPixelSize(5)
        d.setDocumentMargin(0)  # 将打印的边距设为0
        # d.setHtml(content)  # 注入html内容
        p.setOutputFormat(QPrinter.NativeFormat)
        d.setHtml(u'%s' % content)
        # doc.print_(p)
        d.print(self.print_device)  # 调用打印机进行打印

    @staticmethod
    def removeHead(text):
        u = "rybprinting://"
        pattern = re.compile(r'rybprinting://')
        if re.findall(pattern, str(text)):
            text = str(text).replace(u, '')
        s = "data:image/jpeg;base64"
        spattern = re.compile(r'data:image/jpeg;base64')
        if re.findall(spattern, str(text)):
            text = str(text).replace(s, '')
        return text

    @staticmethod
    def print_image(printer, data_url):
        print("当前打印机：" + str(printer))
        printerInfo = QPrinterInfo()
        p = QPrinter()
        for item in printerInfo.availablePrinters():
            if printer == str(item.printerName()):
                p = QPrinter(item)
        print(data_url)
        image_content = base64.b64decode(data_url)  # 数据流base64解码
        image = QImage()
        image.loadFromData(image_content)  # 使用QImage构造图片
        painter = QPainter(p)  # 使用打印机作为绘制设备
        painter.drawImage(0, 0, image)  # 进行绘制（即调起打印服务）
        painter.end()  # 打印结束

    @staticmethod
    def getPrinter(p):
        printer = []
        printerInfo = QPrinterInfo()
        print('availablePrinterNames', printerInfo.availablePrinterNames())
        print('defaultPrinterName', printerInfo.defaultPrinterName())
        for item in printerInfo.availablePrinters():
            printer.append(item.printerName())
        if p in printer:
            print(p)
            return p
        else:
            print(printerInfo.defaultPrinterName())
            return printerInfo.defaultPrinterName()

    @staticmethod
    def printing(printer, context):
        print("当前打印机：" + str(printer))
        printerInfo = QPrinterInfo()
        p = QPrinter()
        for item in printerInfo.availablePrinters():
            if printer == str(item.printerName()):
                p = QPrinter(item)
        doc = QTextDocument()
        doc.setPageSize(QSizeF(p.logicalDpiX() * (80 / 25.4), p.logicalDpiY() * (3500 / 25.4)))
        doc.setHtml(context)
        print("开始打印")
        # doc.print_(p)


class Print(QObject):
    def __init__(self, p):
        super().__init__()
        self.printer = Printer(p)

    @pyqtSlot(str, result=str)
    def print(self, content):
        self.printer.print(content)
        return


